// src/Components/User/AccessLog.js
import React, { useEffect, useState } from "react";
import AOS from "aos";
import "aos/dist/aos.css";

export default function AccessLog() {
  const [selectedLog, setSelectedLog] = useState(null);

  useEffect(() => {
    const token = localStorage.getItem("token");
    if (!token) {
      window.location.href = "/login"; // Redirect if no token
      return;
    }
    AOS.init({ duration: 1200, once: false });
  }, []);

  const fetchLogs = async (userId) => {
    try {
      const res = await fetch(`http://localhost:5000/access-log/${userId}`);
      const data = await res.json();
      setLogs(data.logs || []);
    } catch (err) {
      console.error("Failed to load logs:", err);
    }
  };

  const handleRowClick = (log) => {
    if (window.innerWidth < 768) {
      setSelectedLog(log);
    }
  };

  const closeModal = () => setSelectedLog(null);

  return (
    <div className="pt-20 min-h-screen px-6 py-8 bg-gradient-to-br from-purple-100 via-blue-50 to-pink-100 dark:from-gray-900 dark:via-gray-800 dark:to-black text-gray-900 dark:text-white">
      <div className="relative z-10 bg-white dark:bg-gray-900 shadow-lg rounded-2xl p-6" data-aos="fade-up">
        <h2 className="text-2xl font-bold mb-6 text-indigo-600 dark:text-sky-400">
          Access Logs
        </h2>

        <div className="overflow-x-auto">
          <table className="min-w-full table-auto border-collapse">
            <thead>
              <tr className="bg-gray-200 dark:bg-gray-800 text-left">
                <th className="p-4">Sr. No.</th>
                <th className="p-4">Action</th>
                <th className="p-4">Description</th>
                <th className="p-4">File Name</th>
                <th className="p-4">Timestamp</th>
              </tr>
            </thead>
            <tbody>
              {logs.map((log, index) => (
                <tr
                  key={log.id}
                  onClick={() => handleRowClick(log)}
                  className="border-b border-gray-300 dark:border-gray-700 hover:bg-gray-100 dark:hover:bg-gray-800 cursor-pointer"
                  data-aos="fade-up"
                  data-aos-delay={index * 100}
                >
                  <td className="p-4">{index + 1}</td>
                  <td className="p-4">{log.action}</td>
                  <td className="p-4">{log.description}</td>
                  <td className="p-4">{log.file_name || "—"}</td>
                  <td className="p-4">{new Date(log.timestamp).toLocaleString()}</td>
                </tr>
              ))}
              {logs.length === 0 && (
                <tr>
                  <td colSpan="5" className="p-4 text-center text-gray-500">
                    No logs available yet.
                  </td>
                </tr>
              )}
            </tbody>
          </table>
        </div>
      </div>

      {/* Modal for Mobile View */}
      {selectedLog && (
        <div
          className="fixed inset-0 bg-black bg-opacity-30 backdrop-blur-sm z-50 flex items-center justify-center px-4"
          onClick={closeModal}
        >
          <div
            className="relative w-full max-w-sm bg-white dark:bg-gray-900 rounded-xl p-6 shadow-xl"
            onClick={(e) => e.stopPropagation()}
          >
            <button
              onClick={closeModal}
              className="absolute top-3 right-3 text-gray-400 hover:text-red-500 text-xl"
            >
              ✖
            </button>
            <h3 className="text-xl font-semibold mb-4 text-center text-indigo-600 dark:text-sky-400">
              Access Log Details
            </h3>
            <ul className="space-y-2 text-sm">
              <li><strong>Action:</strong> {selectedLog.action}</li>
              <li><strong>Description:</strong> {selectedLog.description}</li>
              <li><strong>File Name:</strong> {selectedLog.file_name || "—"}</li>
              <li><strong>Timestamp:</strong> {new Date(selectedLog.timestamp).toLocaleString()}</li>
            </ul>
          </div>
        </div>
      )}
    </div>
  );
}
